import React from 'react';
import s from './styles/Home.module.css';
const Home = () => {
  const imgUrl = 'https://picsum.photos/200';
  const imgUrl2 = 'https://picsum.photos/700/400';
  const imgUrl3 = 'https://picsum.photos/600/300';
  const imgUrl4 = 'https://picsum.photos/750/450';
  const imgUrl5 = 'https://picsum.photos/800/500';
  const imgUrl6 = 'https://picsum.photos/701/400';

  console.log(Math.random() * (700 - 600) + 500);

  return (
    <div className={s.container}>
      <div className={s.wrapper1}>
        <img
          src={`https://picsum.photos/${Math.round(
            Math.random() * (700 - 600) + 500
          )}`}
          className={s.img}
        />
      </div>
      <div className={s.wrapper2}>
        <img src={imgUrl4} className={s.img2} />
        <img src={imgUrl3} className={s.img2} />
        <img src={imgUrl5} className={s.img2} />
        <img src={imgUrl2} className={s.img2} />
        <img src={imgUrl6} className={s.img2} />
      </div>
    </div>
  );
};

export default Home;
